import axios from "axios";
const API_URL = "http://localhost:8080/cart";
class CartService {
  CartAdd(productID, quantity) {
    // return axios.post(API_URL + "/" + ProductID + "/purchase", { quantity });
    return axios.post(`${API_URL}/${productID}/purchase`, { quantity });
  }
}
export default new CartService();
